package uk.gov.moj.cpp.stagingdvla.aggregate.model;import uk.gov.justice.cpp.stagingdvla.event.DriverNotified;public class DriverNotifiedHistory {    private DriverNotified latest;    private DriverNotified previous;    public DriverNotifiedHistory(final DriverNotified latest, final DriverNotified previous) {        this.latest = latest;        this.previous = previous;    }    public DriverNotified getLatest() {        return latest;    }    public void setLatest(final DriverNotified latest) {        this.latest = latest;    }    public DriverNotified getPrevious() {        return previous;    }    public void setPrevious(final DriverNotified previous) {        this.previous = previous;    }}